		public static IEnumerable<HoloCard> Get()
		{
			return TheCards.Where(c => c.rarity != HoloRarity.DELETED);
		}

		public static HoloCard Find(Sets set, double setNum, HoloRarity rarity)
		{
			return TheCards.Where(c => c.set == set && c.setNum == setNum && c.rarity == rarity).First();
		}

		public static HoloCard FindUnnumbered(string name, HoloRarity rarity)
		{
			return TheCards.Where(c => c.name == name && c.rarity == rarity && c.set == Sets.Unnumbered_Promo && c.setNum == -1).First();
		}

		public static HoloCard[] HasDuplicates()
		{
			int count = TheCards.Length;

			for (int i = 0; i < count; i++)
			{
				for (int j = 0; j < count; j++)
				{
					if (i != j && TheCards[i].IsEqualTo(TheCards[j]))
						return new HoloCard[] { TheCards[i], TheCards[j] };
				}
			}

			return null;
		}
	}
